import React,{useState} from 'react';
import styled from 'styled-components';


const Button=styled.img`
  width:24px;
  height:24px;
  float:right;
  margin-top:20px;
  margin-right: 100px;
`
const MainLayout=styled.div`
  width:100%;
  height:100%;
  background-color:#FFEBF0;
`
function Main() {
  const [modal,setModal]=useState(false)
  function onNewPost(){
    setModal(true)
  }
  return (
    <MainLayout>
      <Button onClick={onNewPost} src='images/newPost/newPost_normal.png'/>
    </MainLayout>


  );
}

export default Main;
